webpackJsonp([57475286295792],{1306:function(e,t){e.exports={data:{package:{type:"unpublished",id:"unpublished/jchavarri/chrome-extension-starter-reason-react",name:"jchavarri/chrome-extension-starter-reason-react",version:"0.1.0",category:"boilerplate",flags:["neglected"],platforms:["browser"],description:"",keywords:["boilerplate"],license:"MIT",updated:"2018-11-10T21:08:55.869Z",stars:18,score:0,quality:0,popularity:0,maintenance:0,readme:'<h1 id="a-chrome-extension-with-reasonreact"><a href="#a-chrome-extension-with-reasonreact" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>A Chrome Extension with ReasonReact</h1>\n<p>This is a starter example to build a Chrome extension using ReasonReact. It is 100% based on the original started project <a href="https://developer.chrome.com/extensions/getstarted">"Getting Started: Building a Chrome Extension"</a>.</p>\n<p>The project consists on placing a clickable icon right next to Chrome\'s Omnibox for easy access. Clicking that icon opens a popup window that allows the user to choose the background color of the current page. If the user had selected a background color for the page earlier, the extension will remember the user\'s choice and use it as the default, once the popup is clicked:</p>\n<p><img src="https://developer.chrome.com/static/images/gettingstarted-preview.png" alt="Getting started preview"></p>\n<h3 id="running"><a href="#running" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Running</h3>\n<p>Run this project:</p>\n<div class="redex-codeblock"><pre class="hljs lang-none"><code>npm install\nnpm start\n<span class="hljs-comment"># in another tab</span>\nnpm run webpack</code></pre></div>\n<p>After you see the webpack compilation succeed (the <code>npm run webpack</code> step), open up the nested html files in <code>src/*</code> (<strong>no server needed!</strong>). Then modify whichever file in <code>src</code> and refresh the page to see the changes.</p>\n<p><strong>For more elaborate ReasonReact examples</strong>, please see <a href="https://github.com/reasonml-community/reason-react-example">https://github.com/reasonml-community/reason-react-example</a></p>\n<h3 id="todo"><a href="#todo" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>TODO</h3>\n<p>Contributions welcomed :)</p>\n<ul>\n<li class="task-list-item"><input type="checkbox" disabled> Make production webpack config</li>\n<li class="task-list-item"><input type="checkbox" disabled> The project is based in <a href="https://github.com/jchavarri/bucklescript-chrome/tree/start-extensions">this temporary branch of <code>bucklescript-chrome</code></a> (the bindings for Chrome API). <code>package.json</code> should be changed once / if the changes are merged upstream</li>\n</ul>\n',homepageUrl:null,repositoryUrl:"https://github.com/jchavarri/chrome-extension-starter-reason-react",npmUrl:null,issuesUrl:null,slug:"/package/unpublished/jchavarri/chrome-extension-starter-reason-react"}},pathContext:{id:"unpublished/jchavarri/chrome-extension-starter-reason-react"}}}});
